import React from "react";
import { View, Text, StyleSheet, Image } from "react-native";

export default class ImageComponent extends React.Component {
  render() {
    return (
      <View>
        <Image
          style={{
            width: 300,
            height: 500,
            resizeMode: "stretch",
          }}
          source={{
            uri:
              "https://images.newindianexpress.com/uploads/user/imagelibrary/2019/12/7/w900X450/PTI12_6_2019_000327B.jpg",
          }}
        />
      </View>
    );
  }
}
